function Content() {
    return (

        <div class="content">
            <div class="content_part">
                <h2>Welcome to the Mercedes-Benz international website.</h2>
                <p>Exclusive reports and current films: experience a broad range of topics from the fascinating world of Mercedes-Benz. To find out about offers in your location, please go to the local Mercedes-Benz website.This is the International website of Mercedes-Benz AG. Visitors from the U.S., please visit our U.S. website<a href="www.mbusa.com">www.mbusa.com</a></p>
                <button>Bring me to local website</button>
            </div>
        </div>
    );

}

export default Content;
